import React, { Component } from "react";
import axios from "axios";
// import "./app.css";
import { BrowserRouter as Router, Redirect, Link } from "react-router-dom";
import { observer, inject } from "mobx-react";
import Prodect from "./product";
import { toJS } from "mobx";
@inject("store")
@observer
class SellerHome extends Component {
  constructor() {
    super();
    this.state = {
      userInfo: {},
      products: []
    };
  }
  async componentDidMount() {
    let answer = await this.props.store.getAllProducts();
    this.setState({
      products: answer.data
    });
  }

  test = () => {
    let products = this.state.products;
    let userProducts = this.props.userInfo.products;
    if (data !== undefined) {
      return (
        <div className="seller-repo">
          {data.map((product, index) => {
            return <Prodect userInfo={product} key={index} />;
          })}
        </div>
      );
    } else {
      return <div />;
    }
  };
  render() {
    return (
      <div>
        <this.test />
      </div>
    );
  }
}

export default SellerHome;
